import React from 'react';

const userOutput = (props) => {
    return (
        <div>
            <p onClick={props.clicked}>{props.name}'s <img src={props.image} alt="Bakery"/>.</p>
            <p>This is a recipe for strawberry short cake.</p>
        </div>
    )
}

export default userOutput;
